import React, { Component } from "react";
import { Container, TextField, Typography } from "@material-ui/core";
import opc2 from "../../assets/img/opc2.jpeg";

const styles = {
  container: {
    margin: "50px",
  },
  image: {
    marginRight: 20,
  },
  product: {
    marginLeft: 25,
    display: "flex",
  },
  prductDetails: {
    display: "block",
  },
};

export default class ProductPage extends Component {
  render() {
    return (
      <div id="productPage" style={styles.container}>
        <Container>
          <div id="product" style={styles.product}>
            <div id="productImage" style={styles.image}>
              <img src={opc2} alt="productImage" style={{ height: 350 }} />
            </div>
            <div id="productDetails" style={styles.prductDetails}>
              <Typography variant='inherit' component='h1'>
              Product Name
              </Typography>
              <Typography>
              <h3>$22</h3>
              </Typography>
              <body style={{ margin: "25px 0" }}>
                One delectable New York Strip Steak. The New York Strip is known
                by other names (Ambassador Steak, Kansas City strip, etc.), but
                its marbling and tenderness deliver one result: fantastic taste.
              </body>
              <TextField
                variant="outlined"
                label="Quantity (lbs)"
                id="quantity"
                required
                placeholder="Enter quantity"
              />
            </div>
          </div>
        </Container>
      </div>
    );
  }
}
